from app.mktcore.mdlimports import *

class MKT_COLLATERAL(exmodel):
	ID 					= 	db.Column(db.String(14), primary_key=True)
	CustomerID 			= 	db.Column(db.String(12))
	Description 		= 	db.Column(db.String(300))
	Currency 			= 	db.Column(db.String(3))
	ValuationPrice 		= 	db.Column(db.Numeric(25, 9))
	ForceSale 			= 	db.Column(db.Numeric(25, 9))
	PurchasePrice 		= 	db.Column(db.Numeric(25, 9))
	MinCollateralValue 	= 	db.Column(db.Numeric(25,9))
	Active 				= 	db.Column(db.String(1))	
