class MKT_COLLATERAL_DE(exmodel):
	ID 					= db.Column(db.String(14), primary_key=True)
	CollateralID 		= db.Column(db.String(14))
	CollateralType 		= db.Column(db.String(2))
	Currency	 		= db.Column(db.String(3))
	CollateralStatus 	= db.Column(db.String(5))
	PurchasePrice 		= db.Column(db.Numeric(25, 9))
	ValuationPrice 		= db.Column(db.Numeric(25, 9))
	ForceSaleValue 		= db.Column(db.Numeric(25, 9))
	Valuer 				= db.Column(db.String(50))
	Description 		= db.Column(db.Text)
	PropertyType 		= db.Column(db.String(14))
	IssuedDate 			= db.Column(db.String(10))
	IssuedPlace 		= db.Column(db.String(50))	
	IssuedBy 			= db.Column(db.String(100))	
	CollateralNumber	= db.Column(db.String(25))	
	Province 			= db.Column(db.String(6))
	District 			= db.Column(db.String(10))
	Commune				= db.Column(db.String(14))
	Village 			= db.Column(db.String(18))
	ReceivedDate 		= db.Column(db.String(10))
	WithdrawalDate 		= db.Column(db.String(10))
	WithdrawalBy 		= db.Column(db.String(35))
	ReceivedBy 			= db.Column(db.String(35))
	OwnershipType   	= db.Column(db.String(1))
	OwnerName   		= db.Column(db.String(35))
	OwnerSpouseName 	= db.Column(db.String(35))
	RelationIndicator   = db.Column(db.String(3))
	# LOS
	HouseNo 			= db.Column(db.String(10))
	StreetNo 			= db.Column(db.String(10))
	Latitude 			= db.Column(db.Text())
	Longitude 			= db.Column(db.Text())
	Location 			= db.Column(db.Text())
	# LEASING
	FrameNo				= db.Column(db.String(20))
	EngineNo			= db.Column(db.String(20))
	Color				= db.Column(db.String(10))
	Brand				= db.Column(db.String(30))
	Model				= db.Column(db.String(30))
	PlateNumber			= db.Column(db.String(15))
	HorsePower			= db.Column(db.String(10))
	Year				= db.Column(db.String(4))

